import React from 'react';
import UTRGVlogo from '../styles/images/College-Logo-Horizontal-[Color-O&W].png';
//import FacebookIcon from '../styles/images/facebook-icon.png';
//import TwitterIcon from '../styles/images/twitter-icon.png';

const Footer = () => (
    <footer className="py-4 bg-dark text-white">
        <div className="container">
            <div className="row">
                <div className="col-md-4 text-left">
                    <img src={UTRGVlogo} alt="University Logo" style={{ width: '100px' }} />
                </div>
                <div className="col-md-4 text-center">
                    <p className="m-0">&copy; 2022 Energy & U. All Rights Reserved.</p>
                </div>
                <div className="col-md-4 text-right">
                    <a href="https://www.facebook.com/youruniversity" target="_blank" rel="noopener noreferrer">
                        <img src={FacebookIcon} alt="Facebook Icon" style={{ width: '25px' }} />
                    </a>
                    <a href="https://www.twitter.com/youruniversity" target="_blank" rel="noopener noreferrer">
                        <img src={TwitterIcon} alt="Twitter Icon" style={{ width: '25px' }} />
                    </a>
                    {/* Add other social media icons as needed */}
                </div>
            </div>
        </div>
    </footer>
);

export default Footer;
